script: |
  super -f text -I q5891.spq | sort > q5891.out

inputs:
  - name: q5891.spq
    data: |
      SELECT ALL - + col2 FROM tab0 (FORMAT parquet) WHERE + col2 IN ( - - col0 - - 87, + col0 + + col0 * + 15, - ( col2 ), - col1 + col2, + col2 * - 93 );
  - name: tab0

outputs:
  - name: q5891.out
    data: |
